import Foundation

public let realInput = ""
private let input = realInput

extension Character {
    func isUppercase() -> Bool {
        return self.unicodeScalars.allSatisfy({ CharacterSet.uppercaseLetters.contains($0) })
    }
    
    func isLowercase() -> Bool {
        return self.unicodeScalars.allSatisfy({ CharacterSet.lowercaseLetters.contains($0) })
    }
    
    func isSameAs(_ other: Character) -> Bool {
        return toupper(CInt(unicodeScalars.first!.value)) == toupper(CInt(other.unicodeScalars.first!.value))
    }
}


public struct Polymer {
    public static func react(_ polymer: String) -> Int {
        let resultString = polymer.reduce("") { (result, nextCharacter) -> String in
            guard let lastChar = result.last else {
                print("\(result)")
                return result.appending(String(nextCharacter))
            }
            
            let reacts = (lastChar.isSameAs(nextCharacter)) && (nextCharacter.isUppercase() != lastChar.isUppercase())
            if reacts {
                return String(result.dropLast())
            } else {
                return result.appending(String(nextCharacter))
            }
        }
        
        return resultString.count
    }
}

